window.bookSummaryJSON = "<p>Bloomsbury presents Throne of Glass by Sarah J. Maas, read by Elizabeth Evans.<br> <br> Lethal. Loyal. Legendary.<br> <br> Enter the world of Throne of Glass with the first book in the #1 bestselling series by Sarah J. Maas.<br> <br> In a land without magic, an assassin is summoned to the castle. She has no love for the vicious king who rules from his throne of glass, but she has not come to kill him. She has come to win her freedom. If she defeats twenty-three murderers, thieves, and warriors in a competition, she will be released from prison to serve as the King’s Champion. <br> <br> Her name is Celaena Sardothien.<br> <br> The Crown Prince will provoke her. The Captain of the Guard will protect her. And a princess from a faraway country will befriend her. But something rotten dwells in the castle, and it’s there to kill. When her competitors start dying mysteriously, one by one, Celaena’s fight for freedom becomes a fight for survival—and a desperate quest to root out the evil before it destroys her world.<br> <br> Thrilling and fierce, Throne of Glass is the first book in the #1 New York Times bestselling series that has captivated readers worldwide.</p>"; 
